import React from 'react'

class Title extends React.Component {
  render(){
    return (
      <React.Fragment>
        <div>
          <h1 className="title">Ukrainian Cyrillic Phonics</h1>
        </div>
      </React.Fragment>
    )
  }
}


export default Title
